import Foundation
import XCTest

@testable import SystemStrings

// MARK: - ExposureNotification Tests

@available(iOS 13.5, *)
final class ExposureNotificationStringsTests: XCTestCase {

    override func tearDown() {
        super.tearDown()
        Util｜ExposureNotification.preferredLocalization = nil
    }

    func test_default() {
        Util｜ExposureNotification.preferredLocalization = nil
        XCTAssertEqual(String.DONT_RESET_BUTTON｜ExposureNotification, "\u{44}\u{6F}\u{6E}\u{2019}\u{74}\u{20}\u{52}\u{65}\u{73}\u{65}\u{74}")
        XCTAssertEqual(String.DONT_SHARE_BUTTON｜ExposureNotification, "\u{44}\u{6F}\u{6E}\u{2019}\u{74}\u{20}\u{53}\u{68}\u{61}\u{72}\u{65}")
        XCTAssertEqual(String.RESET_BUTTON｜ExposureNotification, "\u{52}\u{65}\u{73}\u{65}\u{74}")
        XCTAssertEqual(String.RESET_MESSAGE｜ExposureNotification, "\u{54}\u{68}\u{69}\u{73}\u{20}\u{77}\u{69}\u{6C}\u{6C}\u{20}\u{64}\u{65}\u{6C}\u{65}\u{74}\u{65}\u{20}\u{79}\u{6F}\u{75}\u{72}\u{20}\u{65}\u{78}\u{70}\u{6F}\u{73}\u{75}\u{72}\u{65}\u{20}\u{68}\u{69}\u{73}\u{74}\u{6F}\u{72}\u{79}\u{20}\u{61}\u{6E}\u{64}\u{20}\u{64}\u{69}\u{61}\u{67}\u{6E}\u{6F}\u{73}\u{69}\u{73}\u{20}\u{6B}\u{65}\u{79}\u{73}\u{2E}")
        XCTAssertEqual(String.RESET_TITLE｜ExposureNotification, "\u{52}\u{65}\u{73}\u{65}\u{74}\u{20}\u{45}\u{78}\u{70}\u{6F}\u{73}\u{75}\u{72}\u{65}\u{20}\u{4E}\u{6F}\u{74}\u{69}\u{66}\u{69}\u{63}\u{61}\u{74}\u{69}\u{6F}\u{6E}\u{20}\u{44}\u{61}\u{74}\u{61}\u{3F}")
        XCTAssertEqual(String.SHARE_BUTTON｜ExposureNotification, "\u{53}\u{68}\u{61}\u{72}\u{65}")
        XCTAssertEqual(String.SHARE_RANDOM_IDS_MESSAGE｜ExposureNotification, "\u{53}\u{68}\u{61}\u{72}\u{69}\u{6E}\u{67}\u{20}\u{49}\u{44}\u{73}\u{20}\u{66}\u{72}\u{6F}\u{6D}\u{20}\u{74}\u{68}\u{65}\u{20}\u{70}\u{61}\u{73}\u{74}\u{20}\u{31}\u{34}\u{20}\u{64}\u{61}\u{79}\u{73}\u{20}\u{68}\u{65}\u{6C}\u{70}\u{73}\u{20}\u{74}\u{68}\u{65}\u{20}\u{61}\u{70}\u{70}\u{20}\u{64}\u{65}\u{74}\u{65}\u{72}\u{6D}\u{69}\u{6E}\u{65}\u{20}\u{77}\u{68}\u{6F}\u{20}\u{73}\u{68}\u{6F}\u{75}\u{6C}\u{64}\u{20}\u{62}\u{65}\u{20}\u{6E}\u{6F}\u{74}\u{69}\u{66}\u{69}\u{65}\u{64}\u{20}\u{74}\u{68}\u{61}\u{74}\u{20}\u{74}\u{68}\u{65}\u{79}\u{27}\u{76}\u{65}\u{20}\u{62}\u{65}\u{65}\u{6E}\u{20}\u{65}\u{78}\u{70}\u{6F}\u{73}\u{65}\u{64}\u{20}\u{74}\u{6F}\u{20}\u{43}\u{4F}\u{56}\u{49}\u{44}\u{2D}\u{31}\u{39}\u{2E}\u{20}\u{52}\u{61}\u{6E}\u{64}\u{6F}\u{6D}\u{20}\u{49}\u{44}\u{73}\u{20}\u{61}\u{72}\u{65}\u{20}\u{61}\u{6E}\u{6F}\u{6E}\u{79}\u{6D}\u{6F}\u{75}\u{73}\u{20}\u{61}\u{6E}\u{64}\u{20}\u{6E}\u{6F}\u{20}\u{6F}\u{74}\u{68}\u{65}\u{72}\u{20}\u{64}\u{61}\u{74}\u{61}\u{20}\u{77}\u{69}\u{6C}\u{6C}\u{20}\u{62}\u{65}\u{20}\u{73}\u{68}\u{61}\u{72}\u{65}\u{64}\u{2E}")
        XCTAssertEqual(String.SHARE_RANDOM_IDS_TITLE｜ExposureNotification, "\u{53}\u{68}\u{61}\u{72}\u{65}\u{20}\u{72}\u{61}\u{6E}\u{64}\u{6F}\u{6D}\u{20}\u{49}\u{44}\u{73}\u{20}\u{77}\u{69}\u{74}\u{68}\u{20}\u{201C}\u{25}\u{40}\u{201D}\u{3F}")
