    func test_ca() {
        Util｜ExposureNotification.preferredLocalization = "\u{63}\u{61}"
        XCTAssertEqual(String.DONT_RESET_BUTTON｜ExposureNotification, "\u{4E}\u{6F}\u{20}\u{72}\u{65}\u{73}\u{74}\u{61}\u{62}\u{6C}\u{69}\u{72}")
        XCTAssertEqual(String.DONT_SHARE_BUTTON｜ExposureNotification, "\u{4E}\u{6F}\u{20}\u{63}\u{6F}\u{6D}\u{70}\u{61}\u{72}\u{74}\u{69}\u{72}")
        XCTAssertEqual(String.RESET_BUTTON｜ExposureNotification, "\u{52}\u{65}\u{73}\u{74}\u{61}\u{62}\u{6C}\u{69}\u{72}")
        XCTAssertEqual(String.RESET_MESSAGE｜ExposureNotification, "\u{54}\u{68}\u{69}\u{73}\u{20}\u{77}\u{69}\u{6C}\u{6C}\u{20}\u{64}\u{65}\u{6C}\u{65}\u{74}\u{65}\u{20}\u{79}\u{6F}\u{75}\u{72}\u{20}\u{65}\u{78}\u{70}\u{6F}\u{73}\u{75}\u{72}\u{65}\u{20}\u{68}\u{69}\u{73}\u{74}\u{6F}\u{72}\u{79}\u{20}\u{61}\u{6E}\u{64}\u{20}\u{64}\u{69}\u{61}\u{67}\u{6E}\u{6F}\u{73}\u{69}\u{73}\u{20}\u{6B}\u{65}\u{79}\u{73}\u{2E}")
